<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />

    <title>Document</title>

  <body>
    <script>
      // Object.prototype
      console.log("Object.prototype ", Object.prototype);
      var b = {};
      console.log("Object.getPrototypeOf(b)", Object.getPrototypeOf(b));
      console.log(
        "Object.getPrototypeOf(Object.prototype)",
        Object.getPrototypeOf(Object.prototype)
      );
    </script>
    <script>
      var b1 = new Object();
      console.log("Object.getPrototypeOf(b1) ", Object.getPrototypeOf(b1));
      console.log(
        "Object.getPrototypeOf(Object.prototype) ",
        Object.getPrototypeOf(Object.prototype)
      );
    </script>
    <script>
      var b1 = new Array();
      console.log("Object.getPrototypeOf(b1) ", Object.getPrototypeOf(b1));
      console.log(
        " Object.getPrototypeOf(Array.prototype) ",
        Object.getPrototypeOf(Array.prototype)
      );
      console.log(
        "Object.getPrototypeOf(Object.prototype) ",
        Object.getPrototypeOf(Object.prototype)
      );
    </script>

      );
